import React from 'react';


class Home extends React.Component{

    render(){
        const mystyle = {
      position : 'absolute',
        top : 40+"%",
        left : 40+ "%"
           };
        return(
            <h1 style={mystyle}>in home</h1>

        )

    }

}
export default Home;
